Actual Solution:
If we take $x = 3t^2 - 9t - 5$ and $y = t^2 - 3t + 2,$ then
\[y = t^2 - 3t + 2 = \frac{3t^2 - 9t + 6}{3} = \frac{x + 11}{3}.\]Thus, the path of the tennis ball traces a line segment.

Furthermore,
\[x = 3t^2 - 9t - 5 = 3 \left( t - \frac{3}{2} \right)^2 - \frac{47}{4}.\]Thus, as $t$ varies from 0 to 4, $x$ varies from $-5$ (at $t = 0$), to $-\frac{47}{4}$ (at $t = \frac{3}{2}$), to 7 (at $t = 4$).  The plot below shows the position of the tennis ball as a function of time $t,$ with the time indicated.

[asy]
unitsize(0.4 cm);

real t;

pair parm (real t) {
  return((3*t^2 - 9*t - 5,t^2 - 3*t + 2));
}

path trail = parm(0);

for (t = 0; t <= 4; t = t + 0.1) {
  trail = trail--parm(t);
}

trail = trail--parm(4);

draw(trail,red);

dot("$0$", parm(0), NW);
dot("$1$", parm(1), NW);
dot("$\frac{3}{2}$", parm(1.5), W);
dot("$2$", parm(2), SE);
dot("$3$", parm(3), SE);
dot("$4$", parm(4), SE);
[/asy]

Thus, the tennis ball traces the line segment with endpoints $\left( -\frac{47}{4}, -\frac{1}{4} \right)$ and $(7,6),$ and its length is
\[\sqrt{\left( 7 + \frac{47}{4} \right)^2 + \left( 6 + \frac{1}{4} \right)^2} = \boxed{\frac{25 \sqrt{10}}{4}}.\]

Note that
\begin{align*}
\operatorname{proj}_{\mathbf{w}} \mathbf{v} &= \left\| \frac{\mathbf{v} \cdot \mathbf{w}}{\|\mathbf{w}\|^2} \mathbf{w} \right\| \\
&= \frac{|\mathbf{v} \cdot \mathbf{w}|}{\|\mathbf{w}\|^2} \cdot \|\mathbf{w}\| \\
&= \frac{|\mathbf{v} \cdot \mathbf{w}|}{\|\mathbf{w}\|}.
\end{align*}Let $\theta$ be the angle between $\mathbf{v}$ and $\mathbf{w}.$  Then $\mathbf{v} \cdot \mathbf{w} = \|\mathbf{v}\| \|\mathbf{w}\| \cos \theta,$ so
\[\frac{|\mathbf{v} \cdot \mathbf{w}|}{\|\mathbf{w}\|} = \frac{|\|\mathbf{v}\| \|\mathbf{w}\| \cos \theta|}{\|\mathbf{w}\|} = \|\mathbf{v}\| |\cos \theta| = 5 |\cos \theta| \le 5.\]Equality occurs when $\theta = 0,$ or when $\mathbf{v}$ and $\mathbf{w}$ point in the same direction, so the largest possible value is $\boxed{5}.$

If $\mathbf{p}$ is the projection of $\mathbf{v}$ onto $\mathbf{w},$ then the length of $\mathbf{p}$ is the leg of a right triangle that has the length of $\mathbf{v}$ as the hypotenuse.  Thus, geometrically, $\|\mathbf{p}\| \le \|\mathbf{v}\| = 5.$

